import './Arrow.css';
import { useNavigate } from 'react-router-dom';
import { HiArrowLeft } from 'react-icons/hi';

// Return Arrow
export default function ReturnArrow() {
 return (
  <div className='wrp-dash-arrow'>
   <Arrow />
  </div>
 );
};

export const ScreenSmall = () => (
 <div className='wrp-arrow-add'>
  <Arrow />
 </div>
);
export const ScreenLarge = () => (
 <div className='wrp-arrow-add'>
  <Arrow />
 </div>
);

export const Arrow = () => {
 const navigation = useNavigate();
 const handlebackarrow = (event) => {
  event.preventDefault();
  navigation(-1);
 };
 return (
  <span onClick={handlebackarrow}><HiArrowLeft size={'1.8em'} /></span>
 )
};
